// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";


contract MyGame is Ownable, ReentrancyGuard {

    using SafeMath for uint256;

    uint256 public constant maxNumberOfPlayers = 20; //Liegt die maximale Spieleranzahl auf 20 fest.
    uint256 public constant minNumberOfPlayers = 3;
    uint256 public constant entryFee = 0.1 * 10**18;

    mapping(address => bool) public hasPaid;

    address payable private contractOwner; //Owner of the contract
    
    address payable private winner;
    address payable[] public players;
    mapping(address => uint256) public joinTimes; // added mapping to record when each player joined
    uint256 public numPlayersWithNumber = 0;


    mapping(address => uint256) public playerNumbers; /**Diese Mapping-Variable speichert die vom Spieler eingereichten Zahlen als Schlssel-Wert-Paare, wobei der Schlssel die Adresse des Spielers und der
    Wert die vom Spieler eingereichte Zahl ist. So knnen die eingereichten Zahlen jedes Spielers schnell abgerufen werden**/
   

    struct Fees {
            uint256 totalEntryFees;
            uint256 serviceFee;
            uint256 winnerReward;
        }
        
        Fees public collectedFees;

       
    uint256 public gameStartTime;
    //uint256 public waitTime = 10 minutes; // 10 Minuten
    //uint256 public timeLeft; // die verbleibende Zeit bis zum Spielbeginn

    bool public gameStarted; // Variable, die angibt, ob das Spiel luft oder nicht.
    bool public gameEnded;  // Variable, die angibt, ob das Spiel beendet ist oder nicht.
    

    event GameStarted(uint256 timestamp);
    event GameEnded(uint256 timestamp, address WinnerAddress);
    event WinnerPaid(address winner, uint256 winnerReward);
    event ServiceFeePaid(address contractOwner, uint256 fee);
    

    constructor(address payable _contractOwner) payable {
            require(_contractOwner != address(0), "The address is invalid");
            contractOwner = _contractOwner;
            gameStarted = false;
            gameEnded = false;
    }



        //update fees
    function updateFees() public onlyOwner {
        collectedFees.totalEntryFees = address(this).balance;
        collectedFees.serviceFee = (collectedFees.totalEntryFees * 1) / 10; //10% service fee
        collectedFees.winnerReward = (collectedFees.totalEntryFees * 9) / 10; //90% of the total entryFees are the winnerReward
    }


        //join the game
    function play() public payable nonReentrant {
        require(gameStarted == false, "This game is already finished!");
        require(!hasPaid[msg.sender], "You have already paid the entry fee");
        require(players.length < maxNumberOfPlayers, "Max number of players reached");
        require(msg.sender != contractOwner, "contract Owner cannot participate");
        if (msg.value != entryFee) {
            revert("Please pay the exact participation fee of 0.1 ether");
        }

        hasPaid[msg.sender] = true;
        
        updateFees();
        joinTimes[msg.sender] = block.timestamp;
        }
        
        //get players
    function getPlayers() external view returns (address payable[] memory) {
        return players;
    }
    
        //submit number
    function submitNumber(uint256 _number) public payable nonReentrant {
        require(gameStarted == false, "You can't submit a number, this game is already finished!");
        require(_number >= 0 && _number <= 1000, "Choose a number between 0 and 1000"); //Nummer ist zwischen 0 und 1000
        require(numPlayersWithNumber < maxNumberOfPlayers, "Max number of players that can submit a number reached, if you paid the entry fee you can get a refund");
        require(playerNumbers[msg.sender] == 0, "You have already submitted a number"); // berprft, ob der Spieler bereits eine Zahl eingereicht hat.
        require(msg.sender != contractOwner, "contract Owner cannot participate"); 
        require(hasPaid[msg.sender], "You must pay the entry fee");
        
        playerNumbers[msg.sender] = _number;
        numPlayersWithNumber++;
        players.push(payable(msg.sender));
        if (numPlayersWithNumber >= 3 && gameStarted == false) {
            startGame();
        } 
    }


        //game start 
     function startGame() public {
        require(gameStarted == false, "The game has already started!");
        require(numPlayersWithNumber <= maxNumberOfPlayers);

            /* if (players.length >= 3) {
                gameStartTime = block.timestamp + waitTime; }*/
        gameStarted = true;
        emit GameStarted(block.timestamp);

        if (gameStarted == true) {
            calculateWinner();
        }
             
    } 


        //Calculates the winner
    function calculateWinner() public returns (address WinnerAddress, uint256 winnerReward, uint256 twoThirdsAverage) {
        require(players.length >= minNumberOfPlayers);
        require(players.length <= 20, "Max number of players reached");
        require(gameStarted == true, "The game has not yet started!");
            //require(gameStartTime + waitTime <= block.timestamp);

        
    
            // Calculate the average of all player numbers
        uint256 sum = 0;
        for (uint256 i = 0; i < players.length; i++) {
            sum += playerNumbers[players[i]];
        }

        uint256 average = sum / players.length;

            //Calculate the closest number to 2/3 of the average
        twoThirdsAverage = (average * 2) / 3;
        uint256 closestDistance = 2**256-1;
        uint256 closestNumber;

            //Calculates the winner
        for (uint256 i = 0; i < players.length; i++) {
            uint256 distance = playerNumbers[players[i]] > twoThirdsAverage ? playerNumbers[players[i]] - twoThirdsAverage : twoThirdsAverage - playerNumbers[players[i]];
            if (distance < closestDistance) {
                closestDistance = distance;
                closestNumber = playerNumbers[players[i]];
                WinnerAddress = players[i]; 

            }
        }
        
            //Counts the number of players with the closest number
        uint256 count = 0;
        for (uint256 i = 0; i < players.length; i++) {
            if (playerNumbers[players[i]] == closestNumber) {
                count++;
            }
        }

            //If there is only one player with the closest number, return their address
        if (count == 1) {
            for (uint256 i = 0; i < players.length; i++) {
                if (playerNumbers[players[i]] == closestNumber) {
                    gameEnded = true;
                    winner = players[i];
                    WinnerAddress = players[i];
                    winnerReward = collectedFees.winnerReward;
                    emit GameEnded(block.timestamp, WinnerAddress);
                    return (WinnerAddress, winnerReward, twoThirdsAverage);
                   
                }
            }
    
        } else {   //If there are more than one player with the closest number, the winner is chosen at random
            uint256 winnerIndex = uint256(keccak256(abi.encodePacked(block.timestamp, block.basefee))) % count;
            uint256 j = 0;
            for (uint256 i = 0; i < players.length; i++) {
                if (playerNumbers[players[i]] == closestNumber) {
                    if (j == winnerIndex) {
                        gameEnded = true;
                        winner = players[i];
                        WinnerAddress = players[i];
                        winnerReward = collectedFees.winnerReward;
                        emit GameEnded(block.timestamp, WinnerAddress);
                        return (WinnerAddress, winnerReward, twoThirdsAverage);
                    }
                    j++;
                }
            }
        } 
        /** If there are multiple players with the closest number, select a random winner among them. Hier wird die Funktion keccak256 
        verwendet, 
        um eine Pseudozufallszahl zu generieren, die auf dem aktuellen Blockzeitstempel und der Schwierigkeit des Blocks basiert. 
        Diese beiden Werte werden zuerst mit der Funktion abi.encodePacked() zusammengefasst, um ein Byte-Array zu erzeugen, 
        das als Argument an keccak256() bergeben wird. Das Ergebnis wird dann in eine uint256-Variable gecastet und mit dem 
        Modulo-Operator % durch count geteilt, um den zuflligen Indexwert zu erzeugen. Da der Hashwert eine Pseudozufallszahl 
        zwischen 0 und 2^256 - 1 
        liefert, wird er modulo der Anzahl der Spieler mit der am nchsten liegenden Zahl zum zwei-Drittel-Durchschnitt genommen, 
        um einen Index innerhalb dieses Bereichs zu erhalten.**/
    
    return (address(0), winnerReward = 0, 0); // no winner found 
    } 

    

    function claimReward() public payable nonReentrant {
            //require(winner != address(0), "Game has not ended yet or no winner declared");
        require(msg.sender == winner || msg.sender == contractOwner, "Only winner or contract contractOwner can claim the reward");
    
            //Winner can withdraw the reward 
        if (msg.sender == winner) {
            require(collectedFees.winnerReward > 0, "The winner reward has already been claimed");
            payable(winner).transfer(collectedFees.winnerReward);
            emit WinnerPaid(winner, collectedFees.winnerReward);
        }
            //ContractOwner can withdraw the serviceFee 
        if (msg.sender == contractOwner) {
            require(collectedFees.serviceFee > 0, "The service fee has already been claimed by the contract owner");
            payable(contractOwner).transfer(collectedFees.serviceFee);
            emit ServiceFeePaid(contractOwner, collectedFees.serviceFee);        
        } 
        collectedFees.totalEntryFees = 0;
        collectedFees.serviceFee = 0;
    }

    function bubbleSort(uint256[] memory arr) internal pure {
        uint256 n = arr.length;
        for (uint256 i = 0; i < n - 1; i++) {
            for (uint256 j = 0; j < n - i - 1; j++) {
                if (arr[j] > arr[j + 1]) { // modified condition here
                    uint256 temp = arr[j];
                    arr[j] = arr[j + 1];
                    arr[j + 1] = temp;
                }
            }
        }
    }


    function seeRanking() public view returns (address[] memory, uint256[] memory, uint256[] memory) {
        require(gameEnded == true, "Das Spiel ist noch nicht beendet");

        address[] memory rankedPlayers = new address[](players.length);
        uint256[] memory rankedNumbers = new uint256[](players.length);
        uint256[] memory ranks = new uint256[](players.length);

        for (uint256 i = 0; i < players.length; i++) {
            rankedPlayers[i] = players[i];
            rankedNumbers[i] = playerNumbers[players[i]];
            ranks[i] = 0;
        }

        bubbleSort(rankedNumbers); // sort the array in descending order

            // assign ranks based on sorted player numbers
        for (uint256 i = 0; i < players.length; i++) {
            for (uint256 j = 0; j < players.length; j++) {
                if (playerNumbers[rankedPlayers[j]] == rankedNumbers[i]) {
                    ranks[j] = i + 1;
                    break;
                }
            }
        }

        return (rankedPlayers, rankedNumbers, ranks);
    }


    function refund() external nonReentrant {
        require(joinTimes[msg.sender] > 0, "You are not a player.");
        require(hasPaid[msg.sender] == true);
        require(block.timestamp >= joinTimes[msg.sender] + 5 minutes, "You cannot get a refund before 5 minutes have passed since the 5 minute joinTime");
        require(playerNumbers[msg.sender] == 0, "You have already submitted a number, you cannot request a refund.");
        removePlayer(); 
        delete joinTimes[msg.sender]; // remove the player from the game
        payable(msg.sender).transfer(entryFee); // refund their entry fee
    }



   function removePlayer() public {
        for (uint i = 0; i < players.length; i++) {
            if (players[i] == msg.sender) {
                // Delete the player from the array
                delete players[i];
                // Move the last element to the deleted position
                players[i] = players[players.length - 1];
                // Remove the last element 
                players.pop();
                break;
            }
        }
    }

     // Add a receive ether function
    receive() external payable {}


    fallback () external payable {
        // reject incoming ether transfers that are not related to playing the game
        require(msg.sender == contractOwner, "Incoming transfers not allowed");
    }
}
